(function (jsPDFAPI) {
	var font =
		"";
	var callAddFont = function () {
		this.addFileToVFS("Roboto-ThinItalic-bold.ttf", font);
		this.addFont("Roboto-ThinItalic-bold.ttf", "Roboto-ThinItalic", "bold");
	};
	jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);

